%[text] # 2D Finite Element Method Uniform Waveguide Eigenmodes
% Finite Element Method Waveguide Mode Analysis
% Author: Alex Santiago Vargas
%
% Purdue University
% ECE 618: Numerical Electromagnetics

% Setup environment
clear; clc; close all; % Clean up MATLAB
format shortEng; % Engineering number format
colormap("spring")
save = 1;

% Define constants
epsilon_0=8.85418781e-12;       % [F/m] Permitivity of free space
mu_0=4*pi*1e-7;                 % [H/m] Permeability of free space
c0 = 1/sqrt(epsilon_0*mu_0);    % [m/s] Speed of light
%%
%[text] ## Settings
% Solver and geometry
shape = 2;             % 1: Rectangular Waveguide, 2: Rectangular Ridge, 3: Circular Waveguide
mode = 2;       % 1: TE Polarization, 2: TM Polarization
N_modes = 4;            % Number of eigenmodes to plot

% Waveguide Size
a = 1;      % Waveguide width (diameter)
b = a/2;    % Waveguide height

% Ridge size
ridge_a = a/2;      % Ridge in a direction
ridge_b = b/2;      % Ridge in b direction
ridge_c = a/3;      % Coax center conductor

% Element size
element = 1/40;


if shape == 1
    shapetxt = 'Rectangular Waveguide';
elseif shape == 2
    shapetxt = 'Ridge Waveguide';
elseif shape == 3
    shapetxt = 'Circular Waveguide';
elseif shape == 4
    shapetxt = 'Coaxial Waveguide';
end
if mode == 1
    polarizationtxt = 'TE';
elseif mode == 2
    polarizationtxt = 'TM';
end
%%
%[text] ## Mesh Generation
if shape == 1 || shape == 2
    % Nodes
    Nx = round(a/element)+1;    % Number of nodes in x-axis
    Ny = round(b/element)+1;    % Number of nodes in y-axis
    
    % Finite elements
    x = linspace(-a/2,a/2,Nx)';     % Coordinates for elements in x-axis
    y = linspace(-b/2,b/2,Ny)';     % Coordinates for elements in y-axis
    
    % Create matrix of coordinates for all finite elements
    [X, Y] = meshgrid(x,y);

elseif shape == 3
    X = 0; Y = 0;
    for r = element:element:a/2
        % Calculate angle and number of elements for each r
        N = round(pi/(2*asin(element/(2*r))));
        theta = cat(2, (pi/N)*(0:N), -fliplr((pi/N)*(1:N-1)));

        x0 = r*cos(theta)';      % x-coordinates of the circle
        y0 = r*sin(theta)';      % y-ccordinates of the circle
        
        % Add coordinates for entire sweep
        X = cat(1, X, x0);
        Y = cat(1, Y, y0);
    end

elseif shape == 4
    X = 0; Y = 0;
    % Start at offset radius for center conductor
    for r = ridge_c/2:element:a/2
        % Calculate angle and number of elements for each r
        N = round(pi/(2*asin(element/(2*r))));
        theta = cat(2, (pi/N)*(0:N), -fliplr((pi/N)*(1:N-1)));

        x0 = r*cos(theta)';      % x-coordinates of the circle
        y0 = r*sin(theta)';      % y-ccordinates of the circle
        
        % Add coordinates for entire sweep
        X = cat(1, X, x0);
        Y = cat(1, Y, y0);
    end
end

% Triangulate mesh
mesh = delaunayTriangulation(X(:),Y(:));        % Pass coordinates for each node in X and Y


% Get edge nodes
BC = freeBoundary(mesh);    % Boundary nodes

if shape == 2
    % Add ridge to boundary
    ridgePoints = unique(find((abs(mesh.Points(:,2)) >= ridge_b/2) & (abs(mesh.Points(:,1)) <= ridge_a/2)));
    BC = unique(cat(1, unique(BC), ridgePoints));
elseif shape ==4
    % Add coax center conductor to boundary
    ridgePoints = find(sqrt((mesh.Points(:,1)).^2+(mesh.Points(:,2)).^2) <= 1.1*ridge_c/2);
    BC = unique(cat(1, unique(BC), ridgePoints));
end

% Plot mesh and boundary
figure(); %[output:54611cfc]
    triplot(mesh) %[output:54611cfc]
    title(shapetxt + " Mesh") %[output:54611cfc]
    xlabel('X [m]') %[output:54611cfc]
    ylabel('Y [m]') %[output:54611cfc]
    axis equal %[output:54611cfc]
    
    hold on; %[output:54611cfc]
    plot(X(BC),Y(BC),'LineStyle','none','Marker','o','MarkerFaceColor','r','MarkerEdgeColor','none') %[output:54611cfc]

    
    % Label nodes
    % nodelabels = arrayfun(@(n) {sprintf('N%d', n)}, (1:size(X(:),1)));
    % Hpl = text(X(:),Y(:),nodelabels,'FontSize',8, ...
    %     'HorizontalAlignment','center','BackgroundColor','white');
    % clear nodelabels Hpl
    % Label elements
    % ic = incenter(mesh);
    % elementlabels = arrayfun(@(x) {sprintf('E%d',x)}, (1:size(mesh,1))');
    % Htl = text(ic(:,1),ic(:,2),elementlabels, 'FontSize',8, ...
    %     'HorizontalAlignment','center','Color','#D95319');
    % clear elementlabels ic Htl
    hold off %[output:54611cfc]
%%
%[text] ## Finite Element Method Solver
N = size(mesh.Points,1);                % Number of nodes
E = size(mesh.ConnectivityList,1);      % Number of elements
Ne = 3;                                 % Number of local nodes

% Initialize matrices
A = zeros(N,N); B = A;

for e = 1:E
    % Get local mesh
    n = mesh(e,:); % Get nodes for local element
    xe = mesh.Points(n,1); % Get local x coordinates
    ye = mesh.Points(n,2); % Get local y coordinates

    % Calculate coefficients for local mesh
    % ae = [xe(2)*ye(3) - xe(3)*ye(2), xe(3)*ye(1) - xe(1)*ye(3), xe(1)*ye(2) - xe(2)*ye(1)];
    be = [ye(2) - ye(3), ye(3) - ye(1), ye(1) - ye(2)];
    ce = [xe(3) - xe(2), xe(1) - xe(3), xe(2) - xe(1)];
    
    % Area of element
    delta = (be(1)*ce(2)-be(2)*ce(1))/2;
    
    % Local matrices
    Ae = (be'*be+ce'*ce)/(4*delta);
    Be(1:Ne,1:Ne) = 2*delta.*(eye(Ne)+1)/24;


    % Assemble global matrix
    A(mesh(e,1:Ne),mesh(e,1:Ne)) = A(mesh(e,1:Ne),mesh(e,1:Ne)) + Ae(1:Ne,1:Ne);
    B(mesh(e,1:Ne),mesh(e,1:Ne)) = B(mesh(e,1:Ne),mesh(e,1:Ne)) + Be(1:Ne,1:Ne);
end

% Enforce BC
if mode == 1
    % Solve and plot all nodes
    inner = 1:N;
elseif mode == 2
    % Remove boundary nodes from solution and plot
    nodes = 1:N;
    nodes(BC) = 0;              % Flag the nodes on the boundary
    inner = nodes(nodes~=0);    % Keep nodes not on th boundary

    % Remove boundary nodes from the problem
    A = A(inner,inner);
    B = B(inner,inner);
end

% Cleanup memory
clear n xe ye ae be ce delta Ae Be
A = sparse(A);
B = sparse(B);

% Solve the eigenvalue problem
[F,kc,N_eig] = sptarn(A,B,1,200*N_modes); %[output:3108c4e0]
% Calculate the cutoff frequencies
kc = real(sqrt(kc));
fc = kc / (2*pi*sqrt(mu_0*epsilon_0));
fc(1:N_modes) %[output:6b8e0fd4]
%%
%[text] ## Plot Eigenmodes
% Plot the eigenmodes for the first N_modes
for i = 1:N_modes %[output:group:9d3aff3c]
    figure(); %[output:9ddff829] %[output:1f4d412f] %[output:7b46234f] %[output:996a73c2]

    % Pre process the data for plotting
    x = X(:); y = Y(:);     % Create column vector for node numbers
    [Fi, x, y] = create2darray(x(inner), y(inner), abs(F(:,i))./max(max(abs(F(:,i)))), element, element); % Rearange data to a uniform grid

    % Plot eigenmode
    contourf(x,y,Fi,'EdgeColor','none') %[output:9ddff829] %[output:1f4d412f] %[output:7b46234f] %[output:996a73c2]
        title(sprintf(['%s ', polarizationtxt, ' Mode %d'],shapetxt,i))
        xlabel('X [m]')
        ylabel('Y [m]')
        colorbar
        axis equal
end %[output:group:9d3aff3c]
%%
%[text] ## Plot Disperssion Curves
% Calculate disperssion
k = 1:40;
kz = real(sqrt(k.^2 - kc(1:N_modes).^2));

% Plot disperssion with normalized axis
figure() %[output:5ae4ca3a]
    for i = 1:N_modes
        plot(k*a,kz(i,:)./k,'DisplayName',string(i)) %[output:5ae4ca3a]
        hold on
    end
    title(sprintf(['%s ', polarizationtxt, ' Disperssion'],shapetxt)) %[output:5ae4ca3a]
    xlabel('k_{z}/k_{0}') %[output:5ae4ca3a]
    ylabel('k_{0} a') %[output:5ae4ca3a]
    h=legend('Location','best'); %[output:5ae4ca3a]
    h.Title.String = 'Mode'; %[output:5ae4ca3a]
    hold off; %[output:5ae4ca3a]

